import React from 'react';
import { useDispatch } from 'react-redux';
import { filterComponents } from '../reducers/loadReducer';

const SearchBar = () => {

  return (
    <div>
      <input onChange={(e) => dispatch(filterComponents(e.target.value))} type="text" />
    </div>
  );
};

export default SearchBar;
